// import './User.css';

const Item = props => {
    return (
        <div className="itemContainer" key={props.id}>
            <img src={props.img} className="user-img" alt={props.name} width="100px" />
            <div className="user-info">
                <h2>{props.name}</h2>
            </div>
        </div>

    )
}

export default Item;
